import React from 'react';
import './App.css';
import ProjectList from './components/ProjectList/ProjectList'

import { fetchProjects } from './services/fetchApi'

class App extends React.Component {
  constructor(){
    super()

    this.state = {
      projects: []
    }
  }

  componentDidMount(){
    fetchProjects()
    .then((response) => {
      this.setState({ projects: response})
    })
  }

  render() {
    return (
      <div className="App">
        <ProjectList
          projects={this.state.projects}
        />
      </div>
    )
  }
}

export default App;
